import React from 'react';

const SquareAtBottom = () => {
  const squareStyle = {
    width: '100px',
    height: '100px',
    backgroundColor: 'blue',
    position: 'relative', // Use relative positioning
    bottom: '0', // Position at the bottom of its containing parent
  };

  return (
    <div style={{ minHeight: '100vh', position: 'relative' }}>
      {/* minHeight: '100vh' ensures the div takes at least the height of the viewport */}
      <div style={squareStyle}></div>
    </div>
  );
};

export default SquareAtBottom;


